import React from 'react'

const Blog = ({ blog }) => {
  const blogStyle = {
    paddingTop: 10,
    paddingLeft: 2,
    border: 'solid',
    borderWidth: 1,
    marginBottom: 5
  }

  return (
    <div style={blogStyle}>
      <div onClick={() => console.log('clicked')}>
        {blog.title} {blog.author}
        <br />
        {blog.url}
        <br />
        {blog.likes}
        <button >like</button>
        <p>Added by </p> {blog.user.name}

      </div>

    </div>
  )
} 

export default Blog
